import { Component } from "react";
import Button from "./Button";
import Title from "./Title";
import './App.css';

class Home extends Component {
    constructor(props) {
        super(props);
    }
    render() {
        return (
            <div className="home">

                <Title text="Home"/>

                <div className="button-area">
                    <Button text="Login"/>
                    <Button text="SignUp"/>
                </div>
            </div>
        );
    }
}

export default Home;
